_header_slider_0_big_title','field_5a86065bf8063'),(1480,99,'header_slider_0_sub_title','Ervaar de ultieme boulderervaring!'),(1481,99,'_header_slider_0_sub_title','field_5a860676f8064'),(1482,99,'header_slider_0_link_text','Ontdek het hier'),(1483,99,'_header_slider_0_link_text','field_5a860684f8065'),(1484,99,'header_slider_0_link_url','20'),(1485,99,'_header_slider_0_link_url','field_5a86068ef8066'),(1486,99,'header_slider','2'),(1487,99,'_header_slider','field_5a860638f8061'),(1488,99,'introduction_small_title','Over ons'),(1489,99,'_introduction_small_title','field_5a8606f8f8068'),(1490,99,'introduction_big_title','Introductie'),(1491,99,'_introduction_big_title','field_5a86070ef8069'),(1492,99,'introduction_content','<p><strong>KlimKaffee is gevestigd in Hangar S, de oude douaneloods te Mechelen. Op de site is er enorm genvesteerd om er een echte belevingssite van te maken. Dit merk je aan de aanwezigheid van circusschool Circolito, polyvalente ruimte voor de Mechelse jeugd, in- en outdoor skatepark, fuifzaal, jeugdhuis, evenementenplein,</strong></p>\r\n<p>KlimKaffee biedt het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde. Naast het pure boulderplezier kan je bij ons terecht voor <strong>groepslessen en personal training</strong> door n van onze coaches. Vervolgens is er tevens plaats voor een uitgebreid aanbod <strong>yogalessen</strong>. Deze vallen bij ons onder de noemer YogaKaffee, wat had je gedacht? Door de grote verscheidenheid aan yoga teachers binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een mooie aanvulling op je boulderregime.</p>\r\n<p>Voor, tijdens of na al het sportgeweld is iedereen ook welkom in het <strong>Kaffee</strong>. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een <strong>verfrissend drankje</strong> of een ontdekking uit onze <strong>uitgebreide bierkaart</strong>. We voorzien ook een wisselende aanbod aan <strong>gezonde maaltijden</strong>.</p>\r\n'),(1493,99,'_introduction_content','field_5a86071bf806a'),(1494,99,'introduction_image','410'),(1495,99,'_introduction_image','field_5a860776f806b'),(1496,99,'openingsuren_title','Openingsuren'),(1497,99,'_openingsuren_title','field_5a86079e87244'),(1498,99,'openingsuren_0_day','Maandag - vrijdag'),(1499,99,'_openingsuren_0_day','field_5a8607d487246'),(1500,99,'openingsuren_0_hours','11u tot 23u'),(1501,99,'_openingsuren_0_hours','field_5a86080587247'),(1502,99,'openingsuren','3'),(1503,99,'_openingsuren','field_5a8607b687245'),(1504,99,'contact_title','Contact'),(1505,99,'_contact_title','field_5a86093963aed'),(1506,99,'contact_location','Douaneplein\r\n2800 Mechelen'),(1507,99,'_contact_location','field_5a86094963aee'),(1508,99,'contact_location_maps',''),(1509,99,'_contact_location_maps','field_5a86096763aef'),(1510,99,'contact_email','boulder@klimkaffee.be'),(1511,99,'_contact_email','field_5a860a4d63af0'),(1512,99,'contact_telephone','04xx xx xx xx'),(1513,99,'_contact_telephone','field_5a860a5f63af1'),(1514,330,'_edit_lock','1519165256:4'),(1515,330,'_edit_last','1'),(1516,330,'mashsb_timestamp',''),(1517,20,'_wp_page_template','page-wat.php'),(1518,20,'big_title',''),(1519,20,'_big_title','field_5a860d544592b'),(1520,20,'small_title',''),(1521,20,'_small_title','field_5a860d674592c'),(1522,20,'content_small_title','Wat is'),(1523,20,'_content_small_title','field_5a860dc15dcb3'),(1524,20,'content_big_title','boulderen?'),(1525,20,'_content_big_title','field_5a860de75dcb4'),(1526,20,'content_blocks_0_content','KlimKaffee biedt het ultieme boulderplezier op onze wand voor jong en oud, beginner tot gevorderde. Boulderen is muurklimmen tot een beperkte hoogte van 4m50. In tegenstelling tot het traditionele indoor muurklimmen maken we geen gebruik van touwen, maar ligt er een dikke valmat als valbescherming. Hierdoor ben je niet afhankelijk van een klimpartner. \r\n\r\nEr is echter een belangrijke teamspirit aanwezig door het samen uitwerken van een route of net dat inzicht dat een collega boulderaar je kan geven tijdens n van je sessies.'),(1527,20,'_content_blocks_0_content','field_5a860e155dcb6'),(1528,20,'content_blocks_0_link_text','Reserveer hier'),(1529,20,'_content_blocks_0_link_text','field_5a860e305dcb7'),(1530,20,'content_blocks_0_link_url','64'),(1531,20,'_content_blocks_0_link_url','field_5a860e395dcb8'),(1532,20,'content_blocks_0_image','249'),(1533,20,'_content_blocks_0_image','field_5a860e405dcb9'),(1534,20,'content_blocks','2'),(1535,20,'_content_blocks','field_5a860df55dcb5'),(1536,34,'_wp_page_template','page-wat.php'),(1537,343,'header_image',''),(1538,343,'_header_image','field_5a860ee43c57b'),(1539,343,'big_title',''),(1540,343,'_big_title','field_5a860d544592b'),(1541,343,'small_title',''),(1542,343,'_small_title','field_5a860d674592c'),(1543,343,'content_small_title',''),(1544,343,'_content_small_title','field_5a860dc15dcb3'),(1545,343,'content_big_title',''),(1546,343,'_content_big_title','field_5a860de75dcb4'),(1547,343,'content_blocks_0_content',''),(1548,343,'_content_blocks_0_content','field_5a860e155dcb6'),(1549,343,'content_blocks_0_link_text',''),(1550,343,'_content_blocks_0_link_text','field_5a860e305dcb7'),(1551,343,'content_blocks_0_link_url',''),(1552,343,'_content_blocks_0_link_url','field_5a860e395dcb8'),(1553,343,'content_blocks_0_image',''),(1554,343,'_content_blocks_0_image','field_5a860e405dcb9'),(1555,343,'content_blocks','1'),(1556,343,'_content_blocks','field_5a860df55dcb5'),(1557,34,'header_image',''),(1558,34,'_header_image','field_5a860ee43c57b'),(1559,34,'big_title',''),(1560,34,'_big_title','field_5a860d544592b'),(1561,34,'small_title',''),(1562,34,'_small_title','field_5a860d674592c'),(1563,34,'content_small_title',''),(1564,34,'_content_small_title','field_5a860dc15dcb3'),(1565,34,'content_big_title','Yogakaffee'),(1566,34,'_content_big_title','field_5a860de75dcb4'),(1567,34,'content_blocks_0_content','Yogakaffee is het uiterst gezellig zaaltje waar we verschillende teachers ruimte bieden om hun geliefkoosde yogavorm te delen met jullie. We proberen er samen met de teachers zoveel mogelijk vormen aan te bieden op elk niveau en in kleine groepen tot 10 personen. Zodoende kan het persoonlijk en warme gevoel van KlimKaffee voortgezet worden bij YogaKaffee.\r\n\r\nWanneer de respectievelijke lessen doorgaan kan je opzoeken in onze agenda en reserveren kan je enkel door gebruik te maken van onze reserveringsmodule'),(1568,34,'_content_blocks_0_content','field_5a860e155dcb6'),(1569,34,'content_blocks_0_link_text','Reserveer hier'),(1570,34,'_content_blocks_0_link_text','field_5a860e305dcb7'),(1571,34,'content_blocks_0_link_url','64'),(1572,34,'_content_blocks_0_link_url','field_5a860e395dcb8'),(1573,34,'content_blocks_0_image','410'),(1574,34,'_content_blocks_0_image','field_5a860e405dcb9'),(1575,34,'content_blocks','1'),(1576,34,'_content_blocks','field_5a860df55dcb5'),(1577,344,'_edit_lock','1519222223:1'),(1578,344,'_edit_last','1'),(1579,344,'mashsb_timestamp',''),(1580,60,'_wp_page_template','page-fotos.php'),(1581,60,'photos','a:5:{i:0;s:3:\"484\";i:1;s:3:\"379\";i:2;s:3:\"378\";i:3;s:3:\"227\";i:4;s:3:\"249\";}'),(1582,60,'_photos','field_5a860f82c4099'),(1583,60,'mashsb_timestamp','1519765681'),(1584,60,'mashsb_shares','0'),(1585,60,'mashsb_jsonshares','{\"total\":0,\"error\":\"\",\"twitter\":0,\"facebook_shares\":0}'),(1586,173,'mashsb_shares','0'),(1587,173,'mashsb_jsonshares','{\"total\":0,\"error\":\"\",\"twitter\":0,\"facebook_shares\":0}'),(1597,170,'mashsb_shares','0'),(1598,170,'mashsb_jsonshares','{\"total\":0,\"error\":\"\",\"twitter\":0,\"facebook_shares\":0}'),(1681,364,'categorie_0_titel','normaal tarief'),(1682,364,'_categorie_0_titel','field_5a8831d69b607'),(1683,364,'categorie_0_categorieen_0_categorie','1 losse 