id interesse in een nieuwe hobby of heeft het nood om zich wekelijks zorgeloos uit te leven? Laat het ons zo snel mogelijk weten en we houden je op de hoogte over de verdere ontwikkeling van het aanbod en wanneer we ermee kunnen starten.'),(2000,380,'_content_2_tekst','field_5a8885f2e7842'),(2001,380,'content','a:3:{i:0;s:5:\"tekst\";i:1;s:5:\"tekst\";i:2;s:5:\"tekst\";}'),(2002,380,'_content','field_5a88698ae7840'),(2003,28,'content_0_kolommen','2'),(2004,28,'_content_0_kolommen','field_5a8869cce7841'),(2005,28,'content_0_tekst','Onze kids bieden we een breed lessenpakket aan dat verder gaat dan enkel boulderen. Tijdens onze lessen focussen we op verant-woorde lichamelijke en geestelijke ontwikkeling. Cordinatie, moti-vatie en zelfvertrouwen komen uitgebreid aan bod. Dit bereiken we door de steun van de trainers, licentiaten LO of gediplomeerde per-sonal trainers, maar ook door de steun van de kids onderling aan elkaar. Zo ontstaat er een sfeer waar ze leren leren van elkaar n zichzelf. Wat dan weer de teamgeest ten goede komt.\r\n\r\n'),(2006,28,'_content_0_tekst','field_5a8885f2e7842'),(2007,28,'content_0_tekst_2',''),(2008,28,'_content_0_tekst_2','field_5a888624e7843'),(2009,28,'content_1_kolommen','2'),(2010,28,'_content_1_kolommen','field_5a8869cce7841'),(2011,28,'content_1_tekst',''),(2012,28,'_content_1_tekst','field_5a8885f2e7842'),(2013,28,'content_1_tekst_2','We zoeken drie leeftijdsgroepen op te starten om deze in een latere fase eventueel uit te breiden met een wedstrijdteam. De lessen worden aangepast aan de respectievelijke leeftijden en de begeleider zorgt voor een aangepaste begeleiding van het niveau van elke deelnemer. Op deze manier worden en blijven de kids gemotiveerd en gestimuleerd om het plezier te beleven in en rond de bouldermuur. We laten de lessen wekelijks doorgaan op woensdag en/of zaterdag.'),(2014,28,'_content_1_tekst_2','field_5a888624e7843'),(2015,28,'content_2_kolommen','1'),(2016,28,'_content_2_kolommen','field_5a8869cce7841'),(2