ebied en worden de banden tussen KlimKaf-fee en YogaKaffee versterkt. Dit onder begeleiding van een ver-frissend drankje of een ontdekking uit onze uitgebreide bier-kaart. We voorzien ook een wisselende aanbod aan gezonde maaltijden. Zowel de gezonde start van de dag, tussendoortje, lekkere soep of volwaardige maaltijd voorzien we graag aan de-mocratische prijzen. Neem gerust je tijd voor een bezoek aan KlimKaffee.'),(2113,395,'_tekst','field_5a8899bfc1ef2'),(2114,395,'menu_link','394'),(2115,395,'_menu_link','field_5a889b95c1ef4'),(2116,46,'tekst','Voor, tijdens of na al het sportgeweld is iedereen welkom in het Kaffee. Hier worden verhalen verteld over waanzinnige en niet overdreven(yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaf-fee en YogaKaffee versterkt. Dit onder begeleiding van een ver-frissend drankje of een ontdekking uit onze uitgebreide bier-kaart. We voorzien ook een wisselende aanbod aan gezonde maaltijden. Zowel de gezonde start van de dag, tussendoortje, lekkere soep of volwaardige maaltijd voorzien we graag aan de-mocratische prijzen. Neem gerust je tijd voor een bezoek aan KlimKaffee.\r\n'),(2117,46,'_tekst','field_5a8899bfc1ef2'),(2118,46,'menu_link','394'),(2119,46,'_menu_link','field_5a889b95c1ef4'),(2121,396,'tekst','Voor, tijdens of na al het sportgeweld is iedereen welkom in het Kaffee. Hier worden verhalen verteld over waanzinnige en niet overdreven(yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaf-fee en YogaKaffee versterkt. Dit onder begeleiding van een ver-frissend drankje of een ontdekking uit onze uitgebreide bier-kaart. We voorzien ook een wisselende aanbod aan gezonde maaltijden. Zowel de gezonde start van de dag, tussendoortje, lekkere soep of volwaardige maaltijd voorzien we graag aan de-mocratische prijzen. Neem gerust je tijd voor een bezoek aan KlimKaffee.\r\n'),(2122,396,'_tekst','field_5a8899bfc1ef2'),(2123,396,'