ider_0_small_title','field_5a86064af8062'),(2329,411,'header_slider_0_big_title','Klimkaffee'),(2330,411,'_header_slider_0_big_title','field_5a86065bf8063'),(2331,411,'header_slider_0_sub_title','Ervaar de ultieme boulderervaring!'),(2332,411,'_header_slider_0_sub_title','field_5a860676f8064'),(2333,411,'header_slider_0_link_text','Ontdek het hier'),(2334,411,'_header_slider_0_link_text','field_5a860684f8065'),(2335,411,'header_slider_0_link_url','20'),(2336,411,'_header_slider_0_link_url','field_5a86068ef8066'),(2337,411,'header_slider_1_background_image','407'),(2338,411,'_header_slider_1_background_image','field_5a860bf43be0b'),(2339,411,'header_slider_1_small_title','Welkom bij'),(2340,411,'_header_slider_1_small_title','field_5a86064af8062'),(2341,411,'header_slider_1_big_title','Klimkaffee'),(2342,411,'_header_slider_1_big_title','field_5a86065bf8063'),(2343,411,'header_slider_1_sub_title','Ervaar de ultieme boulderervaring!'),(2344,411,'_header_slider_1_sub_title','field_5a860676f8064'),(2345,411,'header_slider_1_link_text','Ontdek het hier'),(2346,411,'_header_slider_1_link_text','field_5a860684f8065'),(2347,411,'header_slider_1_link_url','20'),(2348,411,'_header_slider_1_link_url','field_5a86068ef8066'),(2349,411,'header_slider','2'),(2350,411,'_header_slider','field_5a860638f8061'),(2351,411,'introduction_small_title','Over ons'),(2352,411,'_introduction_small_title','field_5a8606f8f8068'),(2353,411,'introduction_big_title','Introductie'),(2354,411,'_introduction_big_title','field_5a86070ef8069'),(2355,411,'introduction_content','<strong>KlimKaffee is gevestigd in Hangar S, de oude douaneloods te Mechelen. Op de site is er enorm genvesteerd om er een echte belevingssite van te maken. Dit merk je aan de aanwezigheid van circusschool Circolito, polyvalente ruimte voor de Mechelse jeugd, in- en outdoor skatepark, fuifzaal, jeugdhuis, evenementenplein,</strong>\r\n\r\nKlimKaffee biedt het ultieme boulderplezier op onze wand voor jong en oud, beginner tot gevorderde. Naast het pure boulderplezier kan je bij ons terecht voor groepslessen en personal training door n van onze coaches. Vervolgens is er tevens plaats voor een uitgebreid aanbod yogalessen. Deze vallen bij ons onder de noemer YogaKaffee, wat had je gedacht? Door de grote verscheidenheid aan yoga teachers binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een mooie aanvulling op je boulderregime.\r\n\r\nVoor, tijdens of na al het sportgeweld is iedereen ook welkom in het Kaffee. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een verfrissend drankje of een ontdekking uit onze uitgebreide bierkaart. We voorzien ook een wisselende aanbod aan gezonde maaltijden.'),(2356,411,'_introduction_content','field_5a86071bf806a'),(2357,411,'introduction_image','410'),(2358,411,'_introduction_image','field_5a860776f806b'),(2359,411,'openingsuren_title',''),(2360,411,'_openingsuren_title','field_5a86079e87244'),(2361,411,'openingsuren_0_day',''),(2362,411,'_openingsuren_0_day','field_5a8607d487246'),(2363,411,'openingsuren_0_hours',''),(2364,411,'_openingsuren_0_hours','field_5a86080587247'),(2365,411,'openingsuren','1'),(2366,411,'_openingsuren','field_5a8607b687245'),(2367,411,'contact_title',''),(2368,411,'_contact_title','field_5a86093963aed'),(2369,411,'contact_location',''),(2370,411,'_contact_location','field_5a86094963aee'),(2371,411,'contact_location_maps',''),(2372,411,'_contact_location_maps','field_5a86096763aef'),(2373,411,'contact_email',''),(2374,411,'_contact_email','field_5a860a4d63af0'),(2375,411,'contact_telephone',''),(2376,411,'_contact_telephone','field_5a860a5f63af1'),(2378,412,'categorie_0_categorie_naam','normaal tarief'),(2379,412,'_categorie_0_categorie_naam','field_5a8831d69b607'),(2380,412,'categorie_0_categorie_soort_