5,413,'_introduction_big_title','field_5a86070ef8069'),(2476,413,'introduction_content','<strong>KlimKaffee is gevestigd in Hangar S, de oude douaneloods te Mechelen. Op de site is er enorm genvesteerd om er een echte belevingssite van te maken. Dit merk je aan de aanwezigheid van circusschool Circolito, polyvalente ruimte voor de Mechelse jeugd, in- en outdoor skatepark, fuifzaal, jeugdhuis, evenementenplein,</strong>\r\n\r\nKlimKaffee biedt het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde. Naast het pure boulderplezier kan je bij ons terecht voor <strong>groepslessen en personal training</strong> door n van onze coaches. Vervolgens is er tevens plaats voor een uitgebreid aanbod <strong>yogalessen</strong>. Deze vallen bij ons onder de noemer YogaKaffee, wat had je gedacht? Door de grote verscheidenheid aan yoga teachers binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een mooie aanvulling op je boulderregime.\r\n\r\nVoor, tijdens of na al het sportgeweld is iedereen ook welkom in het <strong>Kaffee</strong>. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een <strong>verfrissend drankje</strong> of een ontdekking uit onze <strong>uitgebreide bierkaart</strong>. We voorzien ook een wisselende aanbod aan <strong>gezonde maaltijden</strong>.'),(2477,413,'_introduction_content','field_5a86071bf806a'),(2478,413,'introduction_image','410'),(2479,413,'_introduction_image','field_5a860776f806b'),(2480,413,'openingsuren_title','Openingsuren'),(2481,413,'_openingsuren_title','field_5a86079e87244'),(2482,413,'openingsuren_0_day','Maandag - vrijdag'),(2483,413,'_openingsuren_0_day','field_5a8607d487246'),(2484,413,'openingsuren_0_hours','11u tot 23u'),(2485,413,'_openingsuren_0_hours','field_5a