e bij ons terecht voor <strong>groepslessen en personal training</strong> door n van onze coaches. Vervolgens is er tevens plaats voor een uitgebreid aanbod <strong>yogalessen</strong>. Deze vallen bij ons onder de noemer YogaKaffee, wat had je gedacht? Door de grote verscheidenheid aan yoga teachers binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een mooie aanvulling op je boulderregime.\r\n\r\nVoor, tijdens of na al het sportgeweld is iedereen ook welkom in het <strong>Kaffee</strong>. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een <strong>verfrissend drankje</strong> of een ontdekking uit onze <strong>uitgebreide bierkaart</strong>. We voorzien ook een wisselende aanbod aan <strong>gezonde maaltijden</strong>.'),(2759,435,'_introduction_content','field_5a86071bf806a'),(2760,435,'introduction_image','410'),(2761,435,'_introduction_image','field_5a860776f806b'),(2762,435,'aanbod_background_image','429'),(2763,435,'_aanbod_background_image','field_5a89ed76ffacc'),(2764,435,'aanbod_title','Aanbod'),(2765,435,'_aanbod_title','field_5a89e978507ae'),(2766,435,'aanbod_information_blocks_0_image','426'),(2767,435,'_aanbod_information_blocks_0_image','field_5a89e9f6507b0'),(2768,435,'aanbod_information_blocks_0_titel','Boulderen'),(2769,435,'_aanbod_information_blocks_0_titel','field_5a89ea0d507b1'),(2770,435,'aanbod_information_blocks_0_content','Het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde'),(2771,435,'_aanbod_information_blocks_0_content','field_5a89ea14507b2'),(2772,435,'aanbod_information_blocks_0_link_text','Meer info'),(2773,435,'_aanbod_information_blocks_0_link_text','field_5a89ea1e507b3'),(2774,435,'aanbod_information_blocks_0_link_url','20'),(2775,435,'_aanbod_information_