_5a860e305dcb7'),(3273,463,'content_blocks_0_link_url','64'),(3274,463,'_content_blocks_0_link_url','field_5a860e395dcb8'),(3275,463,'content_blocks_0_image','249'),(3276,463,'_content_blocks_0_image','field_5a860e405dcb9'),(3277,463,'content_blocks_1_content','Naast het pure boulderplezier kan je bij ons terecht voor groepslessen en personal training door n van onze coaches  voor specifieke trainingen, herstel na een blessure of om net de moeilijke stapje vooruit te zetten. Meer info hierover vindt u bij <a href=\"http://klimkaffee.akxis.io/yoga/trainingen/\">trainingen</a>. \r\n\r\nVoor de kids hebben we een doordacht lessenpakket samengesteld, waarin de kids per leeftijdsklasse wekelijks kunnen komen klimmen. De samenstelling van de groepen en bijkomende info vind je <a href=\"http://klimkaffee.akxis.io/groepen/\">hier</a>. '),(3278,463,'_content_blocks_1_content','field_5a860e155dcb6'),(3279,463,'content_blocks_1_link_text',''),(3280,463,'_content_blocks_1_link_text','field_5a860e305dcb7'),(3281,463,'content_blocks_1_link_url',''),(3282,463,'_content_blocks_1_link_url','field_5a860e395dcb8'),(3283,463,'content_blocks_1_image','249'),(3284,463,'_content_blocks_1_image','field_5a860e405dcb9'),(3285,463,'content_blocks','2'),(3286,463,'_content_blocks','field_5a860df55dcb5'),(3287,20,'content_blocks_1_content','Naast het pure boulderplezier kan je bij ons terecht voor groepslessen en personal training door n van onze coaches  voor specifieke trainingen, herstel na een blessure of om net de moeilijke stapje vooruit te zetten. Meer info hierover vindt u bij <a href=\"http://klimkaffee.akxis.io/yoga/trainingen/\">trainingen</a>. \r\n\r\nVoor de kids hebben we een doordacht lessenpakket samengesteld, waarin de kids per leeftijdsklasse wekelijks kunnen komen klimmen. De samenstelling van de groepen en bijkomende info vind je <a href=\"http://klimkaffee.akxis.io/groepen/\">hier</a>. '),(3288,20,'_content_blocks_1_content','field_5a860e155dcb6'),(3289,20,'content_blocks_1_link_text',''),(3290,20,'_content_blocks_1_link_text','field_5a860e305dcb7'),(3291,20,'content_blocks_1_link_url',''),(3292,20,'_content_blocks_1_link_url','field_5a860e395dcb8'),(3293,20,'content_blocks_1_image','249'),(3294,20,'_content_blocks_1_image','field_5a860e405dcb9'),(3295,464,'header_image',''),(3296,464,'_header_image','field_5a860ee43c57b'),(3297,464,'big_title',''),(3298,464,'_big_title','field_5a860d544592b'),(3299,464,'small_title',''),(3300,464,'_small_title','field_5a860d674592c'),(3301,464,'content_small_title',''),(3302,464,'_content_small_title','field_5a860dc15dcb3'),(3303,464,'content_big_title',''),(3304,464,'_content_big_title','field_5a860de75dcb4'),(3305,464,'content_blocks_0_content','Yogakaffee is het uiterst gezellig zaaltje waar we verschillende teachers ruimte bieden om hun geliefkoosde yogavorm te delen met jullie. We proberen er samen met de teachers zoveel mogelijk vormen aan te bieden op elk niveau en in kleine groepen tot 10 personen. Zodoende kan het persoonlijk en warme gevoel van KlimKaffee voortgezet worden bij YogaKaffee.\r\n\r\nWanneer de respectievelijke lessen doorgaan kan je opzoeken in onze agenda en reserveren kan je enkel door gebruik te maken van onze reserveringsmodule'),(3306,464,'_content_blocks_0_content','field_5a860e155dcb6'),(3307,464,'content_blocks_0_link_text','Reserveer hier'),(3308,464,'_content_blocks_0_link_text','field_5a860e305dcb7'),(3309,464,'content_blocks_0_link_url','64'),(3310,464,'_content_blocks_0_link_url','field_5a860e395dcb8'),(3311,464,'content_blocks_0_image','410'),(3312,464,'_content_blocks_0_image','field_5a860e405dcb9'),(3313,464,'content_blocks','1'),(3314,464,'_content_blocks','field_5a860df55dcb5'),(3315,465,'header_image',''),(3316,465,'_header_image','field_5a860ee43c57b'),(3317,465,'big_title',''),(3318,465,'_big_title','field_5a860d544592b'),(3319,465,'small_title',''),(3320,465,'_small_title','field_5a860d674592c'),(3321,465,'content_small_title',''),(3322,465,'_content_small