field_5a860684f8065'),(3717,504,'header_slider_0_link_url','20'),(3718,504,'_header_slider_0_link_url','field_5a86068ef8066'),(3719,504,'header_slider_1_background_image','407'),(3720,504,'_header_slider_1_background_image','field_5a860bf43be0b'),(3721,504,'header_slider_1_small_title','Welkom bij'),(3722,504,'_header_slider_1_small_title','field_5a86064af8062'),(3723,504,'header_slider_1_big_title','Klimkaffee'),(3724,504,'_header_slider_1_big_title','field_5a86065bf8063'),(3725,504,'header_slider_1_sub_title','Ervaar de ultieme boulderervaring!'),(3726,504,'_header_slider_1_sub_title','field_5a860676f8064'),(3727,504,'header_slider_1_link_text','Ontdek het hier'),(3728,504,'_header_slider_1_link_text','field_5a860684f8065'),(3729,504,'header_slider_1_link_url','20'),(3730,504,'_header_slider_1_link_url','field_5a86068ef8066'),(3731,504,'header_slider','2'),(3732,504,'_header_slider','field_5a860638f8061'),(3733,504,'introduction_small_title','Over ons'),(3734,504,'_introduction_small_title','field_5a8606f8f8068'),(3735,504,'introduction_big_title','Introductie'),(3736,504,'_introduction_big_title','field_5a86070ef8069'),(3737,504,'introduction_content','<p><strong>KlimKaffee is gevestigd in Hangar S, de oude douaneloods te Mechelen. Op de site is er enorm genvesteerd om er een echte belevingssite van te maken. Dit merk je aan de aanwezigheid van circusschool Circolito, polyvalente ruimte voor de Mechelse jeugd, in- en outdoor skatepark, fuifzaal, jeugdhuis, evenementenplein,</strong></p>\r\n<p>KlimKaffee biedt het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde. Naast het pure boulderplezier kan je bij ons terecht voor <strong>groepslessen en personal training</strong> door n van onze coaches. Vervolgens is er tevens plaats voor een uitgebreid aanbod <strong>yogalessen</strong>. Deze vallen bij ons onder de noemer YogaKaffee, wat had je gedacht? Door de grote verscheidenheid aan yoga teachers binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een mooie aanvulling op je boulderregime.</p>\r\n<p>Voor, tijdens of na al het sportgeweld is iedereen ook welkom in het <strong>Kaffee</strong>. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een <strong>verfrissend drankje</strong> of een ontdekking uit onze <strong>uitgebreide bierkaart</strong>. We voorzien ook een wisselende aanbod aan <strong>gezonde maaltijden</strong>.</p>\r\n'),(3738,504,'_introduction_content','field_5a86071bf806a'),(3739,504,'introduction_image','410'),(3740,504,'_introduction_image','field_5a860776f806b'),(3741,504,'aanbod_background_image','503'),(3742,504,'_aanbod_background_image','field_5a89ed76ffacc'),(3743,504,'aanbod_title','Aanbod'),(3744,504,'_aanbod_title','field_5a89e978507ae'),(3745,504,'aanbod_information_blocks_0_image','426'),(3746,504,'_aanbod_information_blocks_0_image','field_5a89e9f6507b0'),(3747,504,'aanbod_information_blocks_0_title','Boulderen'),(3748,504,'_aanbod_information_blocks_0_title','field_5a89ea0d507b1'),(3749,504,'aanbod_information_blocks_0_content','<p>Het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde</p>\r\n'),(3750,504,'_aanbod_information_blocks_0_content','field_5a89ea14507b2'),(3751,504,'aanbod_information_blocks_0_link_text','Meer info'),(3752,504,'_aanbod_information_blocks_0_link_text','field_5a89ea1e507b3'),(3753,504,'aanbod_information_blocks_0_link_url','20'),(3754,504,'_aanbod_information_blocks_0_link_url','field_5a89ea2a507b4'),(3755,504,'aanbod_information_blocks_1_image','427'),(3756,504,'_aanbod_information_blocks_1_image','field_5a89e9f6507b0'),(3757,504,'aanbod_information_blocks_1_title','Yoga'),(3758,504,'_aanbod_information_blocks_1_title','field_5a89ea0d507b1'),(3759,504,'aan