lkom in het <strong>Kaffee</strong>. Hier worden verhalen verteld over waanzinnige en niet overdreven (yeah right) klimavonturen, tips gegeven over ht te ontdekken klimgebied en worden de banden tussen KlimKaffee en YogaKaffee versterkt. Dit onder begeleiding van een <strong>verfrissend drankje</strong> of een ontdekking uit onze <strong>uitgebreide bierkaart</strong>. We voorzien ook een wisselende aanbod aan <strong>gezonde maaltijden</strong>.</p>\r\n'),(3949,508,'_introduction_content','field_5a86071bf806a'),(3950,508,'introduction_image','410'),(3951,508,'_introduction_image','field_5a860776f806b'),(3952,508,'aanbod_background_image','507'),(3953,508,'_aanbod_background_image','field_5a89ed76ffacc'),(3954,508,'aanbod_title','Aanbod'),(3955,508,'_aanbod_title','field_5a89e978507ae'),(3956,508,'aanbod_information_blocks_0_image','426'),(3957,508,'_aanbod_information_blocks_0_image','field_5a89e9f6507b0'),(3958,508,'aanbod_information_blocks_0_title','Boulderen'),(3959,508,'_aanbod_information_blocks_0_title','field_5a89ea0d507b1'),(3960,508,'aanbod_information_blocks_0_content','<p>Het <strong>ultieme boulderplezier</strong> op onze wand voor jong en oud, beginner tot gevorderde</p>\r\n'),(3961,508,'_aanbod_information_blocks_0_content','field_5a89ea14507b2'),(3962,508,'aanbod_information_blocks_0_link_text','Meer info'),(3963,508,'_aanbod_information_blocks_0_link_text','field_5a89ea1e507b3'),(3964,508,'aanbod_information_blocks_0_link_url','20'),(3965,508,'_aanbod_information_blocks_0_link_url','field_5a89ea2a507b4'),(3966,508,'aanbod_information_blocks_1_image','427'),(3967,508,'_aanbod_information_blocks_1_image','field_5a89e9f6507b0'),(3968,508,'aanbod_information_blocks_1_title','Yoga'),(3969,508,'_aanbod_information_blocks_1_title','field_5a89ea0d507b1'),(3970,508,'aanbod_information_blocks_1_content','<p>Binnen Yogakaffee vindt iedereen wel een yogaclass die bij hem of haar past. Een schitterende hobby en een <strong>mooie aanvulling op je boulderregime</strong>.</p>\r\n'),(3971,508,'_aanbod_information_blocks_1_content','field_5a89ea14507b2'),(3972,508,'aanbod_information_blocks_1_link_text','Meer info'),(3973,508,'_aanbod_information_blocks_1_link_text','field_5a89ea1e507b3'),(3974,508,'aanbod_information_blocks_1_link_url','34'),(3975,508,'_aanbod_information_blocks_1_link_url','field_5a89ea2a507b4'),(3976,508,'aanbod_information_blocks_2_image','428'),(3977,508,'_aanbod_information_blocks_2_image','field_5a89e9f6507b0'),(3978,508,'aanbod_information_blocks_2_title','Kaffee'),(3979,508,'_aanbod_information_blocks_2_title','field_5a89ea0d507b1'),(3980,508,'aanbod_information_blocks_2_content','<p>Voor, tijdens of na al het sportgeweld is iedereen welkom in het Kaffee. Hier worden verhalen verteld over waanzinnige en niet overdreven klimavonturen.</p>\r\n'),(3981,508,'_aanbod_information_blocks_2_content','field_5a89ea14507b2'),(3982,508,'aanbod_information_blocks_2_link_text','Meer info'),(3983,508,'_aanbod_information_blocks_2_link_text','field_5a89ea1e507b3'),(3984,508,'aanbod_information_blocks_2_link_url','48'),(3985,508,'_aanbod_information_blocks_2_link_url','field_5a89ea2a507b4'),(3986,508,'aanbod_information_blocks','3'),(3987,508,'_aanbod_information_blocks','field_5a89e9a1507af'),(3988,508,'openingsuren_title','Openingsuren'),(3989,508,'_openingsuren_title','field_5a86079e87244'),(3990,508,'openingsuren_0_day','Maandag - vrijdag'),(3991,508,'_openingsuren_0_day','field_5a8607d487246'),(3992,508,'openingsuren_0_hours','11u tot 23u'),(3993,508,'_openingsuren_0_hours','field_5a86080587247'),(3994,508,'openingsuren_1_day','Zaterdag'),(3995,508,'_openingsuren_1_day','field_5a8607d487246'),(3996,508,'openingsuren_1_hours','10u tot 20u'),(3997,508,'_openingsuren_1_hours','field_5a86080587247'),(3998,508,'openingsuren_2_day','Zondag'),(3999,508,'_openingsuren_2_day','field_5a8607d487246'),(4000,508,'openingsuren_2_hours','10u tot 20u'),(4001,508,'_openingsuren_2_hours','field_5a86080587247'),(4002,508,'opening