line_featured_image','0'),(4049,398,'inline_featured_image','0'),(4050,143,'inline_featured_image','0'),(4051,144,'inline_featured_image','0'),(4052,145,'inline_featured_image','0'),(4053,148,'inline_featured_image','0'),(4054,149,'inline_featured_image','0'),(4055,399,'inline_featured_image','0'),(4056,151,'inline_featured_image','0'),(4057,152,'inline_featured_image','0'),(4058,153,'inline_featured_image','0'),(4059,154,'inline_featured_image','0'),(4060,155,'inline_featured_image','0'),(4061,400,'inline_featured_image','0'),(4062,157,'inline_featured_image','0'),(4063,158,'inline_featured_image','0'),(4064,401,'inline_featured_image','0'),(4065,160,'inline_featured_image','0'),(4066,161,'inline_featured_image','0'),(4067,402,'inline_featured_image','0'),(4068,164,'inline_featured_image','0'),(4069,165,'inline_featured_image','0'),(4070,166,'inline_featured_image','0'),(4071,58,'inline_featured_image','0'),(4073,510,'content_0_content_type_0_tekst','Onze kids bieden we een breed lessenpakket aan dat verder gaat dan enkel boulderen. Tijdens onze lessen focussen we op verantwoorde lichamelijke en geestelijke ontwikkeling. Cordinatie, motivatie en zelfvertrouwen komen uitgebreid aan bod. Dit bereiken we door de steun van de trainers, licentiaten LO of gediplomeerde personal trainers, maar ook door de steun van de kids onderling aan elkaar. Zo ontstaat er een sfeer waar ze leren leren van elkaar n zichzelf. Wat dan weer de teamgeest ten goede komt.'),(4074,510,'_content_0_content_type_0_tekst','field_5a888a5e010b0'),(4075,510,'content_0_content_type','a:1:{i:0;s:5:\"tekst\";}'),(4076,510,'_content_0_content_type','field_5a8889fe010af'),(4077,510,'content_0_content_type_2_0_afbeelding','379'),(4078,510,'_content_0_content_type_2_0_afbeelding','field_5a888c0a0e72f'),(4079,510,'content_0_content_type_2','a:1:{i:0;s:10:\"afbeelding\";}'),(4080,510,'_content_0_content_type_2','field_5a888c0a0e72d'),(4081,510,'content_1_content_type_0_afbeelding','378'),(4082,510,'_content_1_content_type_0_afbeelding','field_5a888bde0e72c'),(4083,510,'content_1_content_type','a:1:{i:0;s:10:\"afbeelding\";}'),(4084,510,'_content_1_content_type','field_5a8889fe010af'),(4085,510,'content_1_content_type_2_0_tekst','We zoeken drie leeftijdsgroepen op te starten om deze in een latere fase eventueel uit te breiden met een wedstrijdteam. De lessen worden aangepast aan de respectievelijke leeftijden en de begeleider zorgt voor een aangepaste begeleiding van het niveau van elke deelnemer. Op deze manier worden en blijven de kids gemotiveerd en gestimuleerd om het plezier te beleven in en rond de bouldermuur. We laten de lessen wekelijks doorgaan op woensdag en/of zaterdag.'),(4086,510,'_content_1_content_type_2_0_tekst','field_5a888c0a0e72e'),(4087,510,'content_1_content_type_2','a:1:{i:0;s:5:\"tekst\";}'),(4088,510,'_content_1_content_type_2','field_5a888c0a0e72d'),(4089,510,'content_2_content_type_0_tekst','We willen zo snel mogelijk na de opstart van KlimKaffee van start gaan met deze lessen. Maar er moet uiteraard genoeg vraag zijn naar deze lessen om ze te kunnen organiseren. Heeft je kid interesse in een nieuwe hobby of heeft het nood om zich wekelijks zorgeloos uit te leven? Laat het ons zo snel mogelijk weten en we houden je op de hoogte over de verdere ontwikkeling van het aanbod en wanneer we ermee kunnen starten.'),(4090,510,'_content_2_content_type_0_tekst','field_5a888a5e010b0'),(4091,510,'content_2_content_type','a:1:{i:0;s:5:\"tekst\";}'),(4092,510,'_content_2_content_type','field_5a8889fe010af'),(4093,510,'content_2_content_type_2_0_afbeelding','238'),(4094,510,'_content_2_content_type_2_0_afbeelding','field_5a888c0a0e72f'),(4095,510,'content_2_content_type_2','a:1:{i:0;s:10:\"afbeelding\";}'),(4096,510,'_content_2_content_type_2','field_5a888c0a0e72d'),(4097,510,'content','3'),(4098,510,'_content','field_5a88698ae7840'),(4099,28,'inline_featured_image','0'),(4100,512,'inline_featured_image','0'),(4102,513,'content_0_content_type_0_tekst','<p>Onze kids bieden we een breed lessenpakket aan dat verder gaat dan enkel boulderen. Tijdens onze lessen focussen we op verantwoorde lichamelijke en geestelijke ontwikkeling. Cordinatie, motivatie en zelfvertrouwen komen uitgebreid aan bod. Dit bereiken we door de steun van de trainers, licentiaten LO of gediplomeerde personal trainers, maar ook door de steun van de kids onderling aan elkaar. Zo ontstaat er een sfeer waar ze leren leren van elkaar n zichzelf. Wat dan weer de teamgeest ten goede komt.</p>\r\nPrijzen kidstrainingen 1 schooljaar: <a href=\"/boulderen/prijzen\">Klik hier</a>'),(4103,513,'_content_0_content_type_0_tekst','field_5a888a5e010b0'),(4104,513,'content_0_content_type','a:1:{i:0;s:5:\"tekst\";}'),(4105,513,'_content_0_content_type','field_5a8889fe010af'),(4106,513,'content_0_content_type_2_0_afbeelding','379'),(4107,513,'_content_0_content_type_2_0_afbeelding','field_5a888c0a0e72f'),(4108,513,'content_0_content_type_2','a:1:{i:0;s:10:\"afbeelding\";}'),(4109,513,'_content_0_content_type_2','field_5a888c0a0e72d'),(4110,513,'content_1_content_type_0_afbeelding','378'),(4111,513,'_content_1_content_type_0_afbeelding','field_5a888bde0e72c'),(4112,513,'content_1_content_type','a:1:{i:0;s:10:\"afbeelding\";}'),(4113,513,'_content_1_content_type','field_5a8889fe010af'),(4114,513,'content_1_content_type_2_0_tekst','<p>We zoeken drie leeftijdsgroepen op te starten om deze in een latere fase eventueel uit te breiden met een wedstrijdteam. De lessen worden aangepast aan de respectievelijke leeftijden en de begeleider zorgt voor een aangepaste begeleiding van het niveau van elke deelnemer. Op deze manier worden en blijven de kids gemotiveerd en gestimuleerd om het plezier te beleven in en rond de bouldermuur. We laten de lessen wekelijks doorgaan op woensdag en/of zaterdag.</p>\r\n'),(4115,513,'_content_1_content_type_2_0_tekst','field_5a888c0a0e72e'),(4116,513,'content_1_content_type_2','a:1:{i:0;s:5:\"tekst\";}'),(4117,513,'_content_1_content_type_2','field_5a888c0a0e72d'),(4118,513,'content_2_content_type_0_tekst','<p>We willen zo snel mogelijk na de opstart van KlimKaffee van start gaan met deze lessen. Maar er moet uiteraard genoeg vraag zijn naar deze lessen om ze te kunnen organiseren. Heeft je kid interesse in een nieuwe hobby of heeft het nood om zich wekelijks zorgeloos uit te leven? Laat het ons zo snel mogelijk weten en we houden je op de hoogte over de verdere ontwikkeling van het aanbod en wanneer we ermee kunnen starten.</p>\r\n'),(4119,513,'_content_2_content_type_0_tekst','field_5a888a5e010b0'),(4120,513,'content_2_content_type','a:1:{i:0;s:5:\"tekst\";}'),(4121,513,'_content_2_content_type','field_5a8889fe010af'),(4122,513,'content_2_content_type_2_0_afbeelding','238'),(4123,513,'_content_2_content_type_2_0_afbeelding','field_5a888c0a0e72f'),(4124,513,'content_2_content_type_2','a:1:{i:0;s:10:\"afbeelding\";}'),(4125,513,'_content_2_content_type_2','field_5a888c0a0e72d'),(4126,513,'content','3'),(4127,513,'_content','field_5a88698ae7840');
