we door de steun van de trainers, licentiaten LO of gediplomeerde per-sonal trainers, maar ook door de steun van de kids onderling aan elkaar. Zo ontstaat er een sfeer waar ze leren leren van elkaar n zichzelf. Wat dan weer de teamgeest ten goede komt.</p>\n\n<p>Prijzen kidstrainingen 1 schooljaar: <a href=\"#\">klik hier</a>\n\n<img src=\"http://192.168.1.6/klimkaffee/wp-content/uploads/2018/02/rachel-430962-300x201.jpg\" alt=\"\" width=\"300\" height=\"201\" class=\"alignnone size-medium wp-image-258\" />\n\n<p>We zoeken drie leeftijdsgroepen op te starten om deze in een latere fase eventueel uit te breiden met een wedstrijdteam. De lessen worden aangepast aan de respectievelijke leeftijden en de begeleider zorgt voor een aangepaste begeleiding van het niveau van elke deelnemer. Op deze manier worden en blijven de kids gemotiveerd en gestimuleerd om het plezier te beleven in en rond de bouldermuur. We laten de lessen wekelijks doorgaan op woensdag en/of zaterdag.</p>\n\n<img src=\"http://192.168.1.6/klimkaffee/wp-content/uploads/2018/02/child_climbing-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" class=\"alignnone size-medium wp-image-259\" />\n\n<p>We willen zo snel mogelijk na de opstart van KlimKaffee van start gaan met deze lessen. Maar er moet uiteraard genoeg vraag zijn naar deze lessen om ze te kunnen organiseren. Heeft je kid interesse in een nieuwe hobby of heeft het nood om zich wekelijks zorgeloos uit te leven? Laat het ons zo snel mogelijk weten en we houden je op de hoogte over de verdere ontwikkeling van het aanbod en wanneer we ermee kunnen starten.</p>','Kids','','inherit','closed','closed','','28-autosave-v1','','','2018-02-14 21:28:26','2018-02-14 21:28:26','',28,'http://192.168.1.6/klimkaffee/nieuws/28-autosave-v1/',0,'revision','',0),(258,4,'2018-02-14 21:07:26','2018-02-14 21:07:26','','rachel-430962','','inherit','open','closed','','rachel-430962','','','2018-02-14 21:07:26','2018-02-14 21:07:26','',28,'http://192.168.1.6/klimkaffee/wp-