eze lessen om ze te kunnen organiseren. Heeft je kid interesse in een nieuwe hobby of heeft het nood om zich wekelijks zorgeloos uit te leven? Laat het ons zo snel mogelijk weten en we houden je op de hoogte over de verdere ontwikkeling van het aanbod en wanneer we ermee kunnen starten.</p>','Kids','','inherit','closed','closed','','28-revision-v1','','','2018-02-14 21:28:36','2018-02-14 21:28:36','',28,'http://192.168.1.6/klimkaffee/nieuws/28-revision-v1/',0,'revision','',0),(262,3,'2018-02-15 18:12:12','2018-02-15 18:12:12','<div class=\"opening-moment\">\r\n                            <p>Maandag - Vrijdag</p>\r\n                            <div class=\"opening-bar\">\r\n                                <div class=\"opening-bar-inner\" style=\"left: 30%;width: 60%;\">\r\n                                    <p>11u</p>\r\n                                    <p>23u</p>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"opening-moment\">\r\n                            <p>Zaterdag</p>\r\n                            <div class=\"opening-bar\">\r\n                                <div class=\"opening-bar-inner\" style=\"left: 20%;width: 55%;\">\r\n                                    <p>10u</p>\r\n                                    <p>20u</p>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"opening-moment\">\r\n                            <p>Zondag</p>\r\n                            <div class=\"opening-bar\">\r\n                                <div class=\"opening-bar-inner\" style=\"left: 20%;width: 55%;\">\r\n                                    <p>10u</p>\r\n                                    <p>20u</p>\r\n                                </div>\r\n                            </div>\r\n                        </div>','Openingsuren','','inherit','closed','closed','',